Yang lo kritik itu namanya Mikro Trans. (Angkot) mikro trans part of Jaklingko. 

Coba mas hilangin kebencian elu. Ada program bagus dr pemerintah buat warga nya dimanfaatin lah. 😂

@Adpfft @vinonaara @itsokedear @pandji transjakarta itu warisan. Ngapain diklaim kerjanya Anies?😂
Yg banyak dibuzzerin pendukung anies itu angkot jaklingko. Dan itu jelas seuprit untuk kebutuhan warga Jakarta. Masih lebih mudah diakses angkot konvensional.🙂

Kok bisa²nya diklaim berhasil. Apa itu kerjaan buzzer? https://t.co/yDsAoHC68i

