@amirsyahoke @zanuargalang @paristiawangN @shesagnostic @pandji @aniesbaswedan Jika seuprit di tempat lo, artinya konvensional banyak kan.
Klo yg konventional diganti semua dgn jaklingko malah arogan, dan lo gak akan komen begini, paling cari alasan yg lain.
Setau gw jaklingko sistem mitra, artinya jumlah armada dgn rute yg dilewati gak berkurang

